import React from 'react';
import Header from '../../components/Main/Header'
import Footer from '../../components/Main/Footer'
import Navbar from '../../components/Main/NavBar';
// Favicons 
import '../../public/assets/img/favicons/favicon.ico'
// Libs CSS
import '../../public/assets/libs/%40fancyapps/fancybox/dist/jquery.fancybox.min.css'
import '../../public/assets/libs/%40fortawesome/fontawesome-free/css/all.min.css'
import '../../public/assets/libs/flickity/dist/flickity.min.css'
import '../../public/assets/libs/highlightjs/styles/vs2015.css'
import '../../public/assets/libs/simplebar/dist/simplebar.min.css'
export default ({ children }) => {

    console.log('render Main')

    return (
        <div>
            <Header />
            <Navbar />
            <div className="content">
                {children}

            </div>
            <Footer />
        </div>
    )
}
